import React from "react";
import Providers from "./components/Providers";

export default function Login () {
    return (
    <>
		<main className="mainForm">
            <form className="login">
                <h1>Login</h1>

                <Providers/>

                <div className="Inputs"></div>
                    <label htmlFor="email">
                        <span></span>
                    </label>
                <button className="submit"></button>
            </form>
		</main>
    </>
    )
}
